-- Util
local function newThread(closure,...)
	local thread = coroutine.create(closure)
	coroutine.resume(thread,...)
	return thread
end
-- 7:59 AM: American Airlines Flight 11 is ready to take off.
-- 8:45 AM: Flight 11 is approaching the North Tower.
wait(30)
-- Plane setup
local plane = workspace.Plane
local tower1MagPart = workspace.TowerOneMagPart
local tower2MagPart = workspace.TowerTwoMagPart
local plane2 = workspace.Plane:Clone()
local lazy, reallylazy = false, false
local plane2SetUp = false
plane.PrimaryPart = plane.PrimaryPartPart
function startPlane1()
	while true do
		if lazy then break end
		plane:SetPrimaryPartCFrame(plane:GetPrimaryPartCFrame()+Vector3.new(0,0,5))
		wait()
	end
end
-- 8:46 AM: Flight 11 crashes into the North Tower.
function makeBoom(posPart)
	local boom = Instance.new("Part", workspace)
	boom.Anchored = true
	boom.CanCollide = false
	boom.Shape = 0
	boom.BrickColor = BrickColor.new(21)
	boom.Size = Vector3.new(1,1,1)
	boom.Position = posPart.Position
	for i = 1, 420 do
		boom.Size = boom.Size + Vector3.new(1,1,1)
		game:GetService("RunService").RenderStepped:Wait()
	end
	for i = 0, 1.5, 0.05 do
		boom.Transparency = i
		wait()
	end
	wait(5)
	boom:Destroy()
	if not plane2SetUp then
		plane2SetUp = true
		newThread(tower2Listener)
		setupPlane2()
	end
end
wait(70)
-- 9:02 AM: Flight 175 approaches the South Tower.
function setupPlane2()
	plane2.Parent = workspace
	plane2.PrimaryPart = plane2.PrimaryPartPart
	plane2:SetPrimaryPartCFrame(workspace.Plane2CF.CFrame)
	-- 9:03 AM: Flight 175 crashes into the South Tower.
	while true do
		if reallylazy then break end
		plane2:SetPrimaryPartCFrame(plane2:GetPrimaryPartCFrame()+Vector3.new(5,0,0))
		wait()
	end
end

function debris(posPart, mag, tower)
	for i = 1, 250 do
		local debris = Instance.new("Part", workspace)
		debris.Anchored = false
		debris.Velocity = (posPart.CFrame.lookVector * 25)
		debris.Size = Vector3.new(math.random()*5,math.random()*5,math.random()*5)
		debris.Position = posPart.Position + Vector3.new(math.random(-25,25),math.random(-25,25),math.random(-25,25))		
		if math.random(1,5) == 1 then Instance.new("Fire", debris); wait() end
	end
-- 9:59 AM: The South Tower collapses.
	wait(30)
	for _,v in pairs(tower:GetChildren()) do
		v.CanCollide = false
		v.Anchored = false
	end
	mag.CanCollide = false; mag.Anchored = false
	posPart.CanCollide = false; posPart.Anchored = false
end

function tower1Listener()
	while true do wait()
		if (tower1MagPart.Position - plane.PrimaryPart.Position).magnitude <= 25 then
			newThread(makeBoom, tower1MagPart)
			for i = 1, 100 do
				local explosion = Instance.new("Explosion")
				explosion.Position = tower1MagPart.Position + Vector3.new(math.random(-150,150), math.random(-100,100) ,math.random(-150,150))
				explosion.Parent = workspace
				explosion.BlastPressure = 69
				wait()
				if i == 10 then for _,v in pairs(plane:GetChildren()) do if v:IsA("BasePart") then v.Anchored = false end end lazy = true plane:breakJoints() end
				if i == 15 then local f = Instance.new("Fire", workspace.DebrisSpewer1); f.Size = 1000; f.Heat = 10000; end
				if i == 30 then newThread(debris, workspace.DebrisSpewer1, tower1MagPart, workspace.Tower1) end
				if i == 60 then local s = Instance.new("Smoke",workspace.DebrisSpewer1); s.Size = 1000; s.RiseVelocity = 1000; s.Color=Color3.new(0.2,.2,.2); s.Opacity=1 end
			end
			break
		end
	end
end

function tower2Listener()
	while true do wait()
		if (tower2MagPart.Position - plane2.PrimaryPart.Position).magnitude <= 25 then
			newThread(makeBoom, tower2MagPart)
			for i = 1, 100 do
				local explosion = Instance.new("Explosion")
				explosion.Position = tower2MagPart.Position + Vector3.new(math.random(-150,150), math.random(-100,100) ,math.random(-150,150))
				explosion.Parent = workspace
