				wait()
				if i == 10 then for _,v in pairs(plane2:GetChildren()) do if v:IsA("BasePart") then v.Anchored = false end end reallylazy = true plane2:breakJoints() end
				if i == 15 then local f = Instance.new("Fire", workspace.DebrisSpewer2); f.Size = 1000; f.Heat = 10000; end
				if i == 30 then newThread(debris, workspace.DebrisSpewer2, tower2MagPart, workspace.Tower2) end
				if i == 60 then local s = Instance.new("Smoke",workspace.DebrisSpewer2); s.Size = 1000; s.RiseVelocity = 1000; s.Color=Color3.new(0.2,.2,.2); s.Opacity=1 end
			end
